css:
@-moz-document domain("programasvirtualespc.net") {
div.main-wrap {
    background-color: #000000;
}.top-bar {
    background: #000000;
    border-top: 4px solid #e54e53;
    border-bottom: 1px solid #19232d;
}.breadcrumbs {
    background: #000000;
    color: #8d97a1; 
}.highlights .meta.above {
    background: #000000;
    color: #a6a6a6;
}li.active p span {
    color: #c7c7c7!important;
}.gallery-title, .section-head {
    background: #000000;
    border: 1px solid #000000;
}div.post-content.description h3 {
    color: #2f7bad;
}.sc-tabs .active a {
    background: #429cd7;
    border-bottom: 1px solid #70c168;
}
}
